import ResultGroup from './ResultGroup';
import {ResultMap} from './ResultMap';

export class Results extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            programs: [],
            error: null,
            isLoaded: false,
            dataToSend: {
                "searchContent": "seattle",
