        const sendData = {
            "searchContent": "seattle",
            "CareerEmp": ["Nursing"],
            "HasCost": false,
            "Under18":false, 
            "HasTransport":false, 
            "HasShadow":false, 
            "GradeLevels":[]
        }

        const response = fetch("http://nwhealthcareerpath.uw.edu/api/v1/search", {
            method: "POST",
            body: JSON.stringify(sendData),
            headers: new Headers({
                'Accept': 'application/json',
                'Content-Type': 'application/json'
              })
        })
        .then(res => res.json())
        .then(
            (result) => {
                console.log(result)
                this.setState({
                    isLoaded: true,
                    programs: result
                });
            },
            (error) => {
                this.setState({
                    isLoaded: true,
                    error
                });
            }
        );
